import React from "react";

class CustomFooter extends React.Component {
  render() {
    return(
      <div className="auth-footer">
          <div className="special-for">
            Special for BI-SI1
          </div>
          <div className="gitlab-link">
            <a href="https://gitlab.fit.cvut.cz/saframa6/bi-si1.2_the_best">Link to project</a>
          </div>
        </div>
    );
  }
}

export { CustomFooter };
